values:
My, my famly needs a break, and we're getting one too. We're going to California to see my family that lives in Long Beach, LA, Northern Hollywood, and all the places around those places. I leave at 6:00 Wednesday morning, and I shall stay there for a week (yay! I get outta school for <u>four</u> days! Two of which are gym days. [Might I express that I despise physical education] XP)Anything to get outta gym. And 4 days is quite a lot of days to me; almost a whole school week.

Why we need a break? Well... This year alone, I had 3, <i>almost 5</i>, deaths in my family. It's been <i>really</i> stressful lately, and we just need a little week-long vacation. I love plane rides. *smiles* And I get to go to Disney Land and Universal Studios!! Kudos to me! ^^;;

And so this explains my future absence. But I want to get a few gifts drawn for my friends on dA before I leave, or, at least, try to. ^^;

~Lucky
